<!--Since Im from Brazil, I couldnt find the url that finds postalCodes,
    So...
    This is a jQuery method that helps me find the CEP (PostCode) that the user mentioned
    This only works for PostCodes from Brazil, in this case, CEP
-->
<script type=""text/javascript"">

    $(""#PostCode"").focusout(function () {

        $.ajax({

            // The URL tells us where the data path will come
            url: 'https://viacep.com.br/ws/' + $(this).val() + '/json/unicode/',
            // The type of data, in this case Json
            dataType: 'json',
            success: function (data) {
                $(""#Address"").val(data.logradouro);
                $(""#City"").val(data.localidade);

                $(""city"").focus();
            }

        });

    });

</script>

");
